        <li>Zresetować hasło do konta Microsoft</li>
        <li>Zaświadczenie z sekretariatu</li>
        <li>Złożyć wniosek o stypendium</li> */}
        <li><a href="ContantEmail.js">SKONTAKTUJ SIĘ Z NAMI PRZEZ EMAIL</a></li>
      </ol>
      <a
        className="App-link"
        href="/help"
        rel="noopener noreferrer"
      >
        UZYSKAJ POMOC (PYTANIA I ODPOWIEDZI)
      </a>
    </header>
    <section class='panel'>



     </section> 
  </div>
  );
}

export default Main;
